import React, {useState} from "react";
import { Container, Navbar } from "react-bootstrap";
import { Box, Typography, IconButton, Menu, MenuItem, Tooltip, Avatar }  from "@mui/material";
import { styled } from "@mui/material/styles";
import {AppBar, Toolbar, Drawer, List, Divider, ListItem, ListItemIcon, ListItemText }  from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";
import AccountCircleIcon from "@mui/icons-material/AccountCircle";
import ExitToAppIcon from "@mui/icons-material/ExitToApp";
import InventoryIcon from "@mui/icons-material/Inventory";
import BuildIcon from "@mui/icons-material/Build";
import ReceiptSharpIcon from "@mui/icons-material/ReceiptSharp";
import InventorySharpIcon from "@mui/icons-material/InventorySharp";


const settings = ["Profile", "Account", "Logout"];

const useStyles = styled((theme) => ({
    root: { flexGrow: 1 },
    menuButton: { marginRight: theme.spacing(2) },
    title: { flexGrow: 1 },
    list: { width: 250 },
    nested: { paddingLeft: theme.spacing(4) },
  }));


function NavbarItems() {
    const [anchorElUser, setAnchorElUser] = useState(null);
    const [drawerOpen, setDrawerOpen] = useState(false);

    const handleOpenUserMenu = (event) => {
        setAnchorElUser(event.currentTarget);
      };

      const handleCloseUserMenu = () => {
        setAnchorElUser(null);
      };

      const toggleDrawer = () => {
        setDrawerOpen(!drawerOpen);
      };
      const classes = useStyles();

  return (
    <div className={classes.root}>
        <AppBar position="static">
        <Toolbar>
          <IconButton
            edge="start"
            className={classes.menuButton}
            color="inherit"
            aria-label="menu"
            onClick={() => toggleDrawer()}
          >
            <MenuIcon />
            <Drawer
              anchor="left"
              open={drawerOpen}
              onClose={() => toggleDrawer()}
            >
              <div className={classes.list}>
                <List>
                  <ListItem button>
                    <ListItemIcon>
                      <InventoryIcon color="primary" />
                    </ListItemIcon>
                    <ListItemText primary="Dashboard" />
                  </ListItem>
                  <ListItem button>
                    <ListItemIcon>
                      <BuildIcon color="primary" />
                    </ListItemIcon>
                    <ListItemText primary="Manage Product" />
                  </ListItem>
                  <ListItem button>
                    <ListItemIcon>
                      <ReceiptSharpIcon color="primary" />
                    </ListItemIcon>
                    <ListItemText primary="Manage Orders" />
                  </ListItem>
                </List>
                <ListItem button>
                  <ListItemIcon>
                    <InventorySharpIcon color="primary" />
                  </ListItemIcon>
                  <ListItemText primary="Manage Users" />
                </ListItem>
                <Divider />
                <List>
                  <ListItem button>
                    <ListItemIcon>
                      <AccountCircleIcon color="primary" />
                    </ListItemIcon>
                    <ListItemText primary="Profile" />
                  </ListItem>
                  <ListItem button>
                    <ListItemIcon>
                      <ExitToAppIcon color="primary" />
                    </ListItemIcon>
                    <ListItemText primary="Logout" />
                  </ListItem>
                </List>
              </div>
            </Drawer>
          </IconButton>
      <Navbar bg="dark" variant="dark">
        <Container>
          <Navbar.Brand href="#home">
            <img
              alt=""
              src="https://d3fgegizptfhv.cloudfront.net/4d7a5efa7e9ff0e0fcb09507b644d9c4/images/client_logo_thumb.png"
              width="30"
              height="30"
              className="d-inline-block align-top"
            />{" "}
            ADMIN PANEL
          </Navbar.Brand>
          <Box sx={{ pl: 100 }}>
            <Tooltip title="Open settings">
              <IconButton onClick={handleOpenUserMenu} sx={{ p: 0 }}>
                <Avatar
                  alt="profile"
                  src="https://mui.com/static/images/avatar/2.jpg"
                />
              </IconButton>
            </Tooltip>
            <Menu
              sx={{ mt: "45px" }}
              id="menu-appbar"
              anchorEl={anchorElUser}
              anchorOrigin={{
                vertical: "top",
                horizontal: "right",
              }}
              keepMounted
              transformOrigin={{
                vertical: "top",
                horizontal: "right",
              }}
              open={Boolean(anchorElUser)}
              onClose={handleCloseUserMenu}
            >
              {settings.map((setting) => (
                <MenuItem key={setting} onClick={handleCloseUserMenu}>
                  <Typography textAlign="center">{setting}</Typography>
                </MenuItem>
              ))}
            </Menu>
          </Box>
        </Container>
      </Navbar>
      </Toolbar>
      </AppBar>
    </div>
  );
}
export default NavbarItems;
